import React from 'react';
import './card.css';
import { Link } from 'react-router-dom';
const Card = () => {
  const nfts = [
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
  ];

  const nfts1 = [
    { src: `${process.env.PUBLIC_URL}/images/g1.png`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g1.png`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
  ];

  return (
<>
<div class="card">
        <img src="" alt="Background" class="background"/>
        <img src="top-right1.jpg" alt="Top Right 1" class="top-right small-image"/>
        <img src="top-right2.jpg" alt="Top Right 2" class="top-right small-image"/>
        <img src="bottom-left.jpg" alt="Bottom Left" class="bottom-left small-image"/>
        <img src="main.jpg" alt="Main Image" class="main-image"/>
    </div>
</>
  );
};

export default Card;
